import { applyFontWeightSemiBold } from "../utilities/fonts";
import { applyCursorDefault } from "../utilities/cursor";
const styles = {
    heading: {
        "&$heading__1, &$heading__2, &$heading__3, &$heading__4, &$heading__5, &$heading__6, &$heading__7": Object.assign({}, applyCursorDefault(), applyFontWeightSemiBold()),
    },
    heading__1: {},
    heading__2: {},
    heading__3: {},
    heading__4: {},
    heading__5: {},
    heading__6: {},
    heading__7: {},
};
export default styles;
